import React from "react";

const ProfilePage = () => {
  return (
    <div style={styles.profilePage}>
      {/* Top Left Panel */}
      <div style={styles.topLeftPanel}>
        <h2 style={styles.panelHeader}>Top Left Panel</h2>
        <ul style={styles.list}>
          {Array.from({ length: 20 }, (_, i) => (
            <li key={i} style={styles.listItem}>
              Profile Detail {i + 1}
            </li>
          ))}
        </ul>
      </div>

      {/* Top Right Panel */}
      <div style={styles.rightPanel}>
        <h2 style={styles.panelHeader}>Top Right Panel</h2>
        <ul style={styles.list}>
          {Array.from({ length: 15 }, (_, i) => (
            <li key={i} style={styles.listItem}>
              Upcoming Event {i + 1} - Date: Dec {i + 1}, 2024
            </li>
          ))}
        </ul>
      </div>

      {/* Bottom Right Panel */}
      <div style={styles.rightPanel}>
        <h2 style={styles.panelHeader}>Bottom Right Panel</h2>
        <ul style={styles.list}>
          {Array.from({ length: 15 }, (_, i) => (
            <li key={i} style={styles.listItem}>
              Participated Project {i + 1} - Status: {i % 2 === 0 ? "Completed" : "Ongoing"}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

const styles = {
  profilePage: {
    display: "grid",
    gridTemplateColumns: "45% 1fr",
    gridTemplateRows: "50% 50%",
    gap: "10px", // Reduced gap between boxes
    height: "100vh",
    padding: "10px",
    boxSizing: "border-box",
    background: "linear-gradient(to bottom right, #f2f2f2, #d9d9d9)",
    color: "#333333",
  },
  topLeftPanel: {
    gridColumn: "1",
    gridRow: "span 2",
    background: "#ffffff",
    borderRadius: "10px",
    padding: "15px",
    overflowY: "auto", // Adds independent scrolling for this box
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.1)",
  },
  rightPanel: {
    background: "#ffffff",
    borderRadius: "10px",
    padding: "15px",
    overflowY: "auto", // Adds independent scrolling for this box
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.1)",
  },
  panelHeader: {
    fontSize: "16px",
    color: "#005bb5",
    marginBottom: "10px",
  },
  list: {
    listStyle: "none",
    padding: 0,
    margin: 0,
  },
  listItem: {
    marginBottom: "8px",
    fontSize: "14px",
    color: "#555555",
  },
};

export default ProfilePage;
